import React from 'react';

function MyAccount() {
  const [name, setName] = React.useState('');
  //list_name, seller, condition, price, available
  return (
    <section>
      <input 
        placeholder="list_name"
        onChange={(e)=>{
          setName(e.target.value);
          console.log(name);
        }}
      />
      <input 
        placeholder="seller"
        onChange={(e)=>{
          setName(e.target.value);
          console.log(name);
        }}
      />
      <input 
        placeholder="condition"
        onChange={(e)=>{
          setName(e.target.value);
          console.log(name);
        }}
      />
      <input 
        placeholder="price"
        onChange={(e)=>{
          setName(e.target.value);
          console.log(name);
        }}
      />
      <input 
        placeholder="true or false"
        onChange={(e)=>{
          setName(e.target.value);
          console.log(name);
        }}
      />
    </section>
  );
};

export default MyAccount;
